import React from 'react';

export default function CreateGroup() {
    return (
        <form id="nameGame">
            <label htmlFor="search">Name of Game</label>
            <input type="text" placeholder="Enter name of the game..." name="gameName"></input>
            <button type="submit"><i className="fa fa-search"></i></button>
        </form>
    );
}
